import PopularRestaurant from './popular-restaurants/PopularRestaurant';
import './HomePage.scss';
import claro from '../../assets/claro.png';
import lumina from '../../assets/mizlala-gret-mullet-fillet.png';
import tiger from '../../assets/screen-shot-2019-01-06-at-10-57-26.png'; 
import SignatureDishes from './signature-dishes/SignatureDishes';

const DUMMY_DATA = [
    {
      id: 'm1',
      restaurantImage: claro,
      name: 'Claro',
      chef: 'Ran Shmueli',
      signature: '',
      description: '',
      icon: '',
      price: ''
    },
    {
      id: 'm2',
      restaurantImage: lumina,
      name: 'Lumina',
      chef: 'Meir Adoni',
      signature: '',
      description: '',
      icon: '',
      price: ''
    },
    {
      id: 'm3',
      restaurantImage: tiger,
      name: 'Tiger Lilly',
      chef: 'Yanir Green',
      signature: '',
      description: '',
      icon: '',
      price: ''
    }
  ];


  const DummyData= () => {
      const popularList= DUMMY_DATA.map((restaurant) => (<PopularRestaurant key={restaurant.id} name={restaurant.name} chef={restaurant.chef} image={restaurant.restaurantImage} />));
      const signatureList= DUMMY_DATA.map((dish) => (<SignatureDishes key={dish.id} name={dish.name} image={dish.dishImage} signature={dish.signature} description={dish.description}/>));

      return(
          <div className='popular-container'>
             {popularList}
          </div>
      )
  }
  export default DummyData;
